Ext.define('Solutions.view.CameraDocument', {
    extend: 'Common.form.FormPanel',

    requires: ['Common.control.field.Document'],

    config: {
        items: [
            {
                xtype: 'documentfield',

                //The name of the field the document data is stored in.
                //This is the document contents field. If the name of the server side field is doc1 the name will be doc1_contents.
                name: 'doc1_contents',

                //The label displayed in the title bar
                label: 'Photo'
            }
        ]
    },

    initialize: function () {
        var documentFields = this.query('documentfield'),
            imageData = "";

        //display a predefined image in the document field
        documentFields[0].setImageData(imageData);
    }
});